import './App.css';
import Header from './Header';
import Schedule from './Schedule';
import Face from './Face';
function App() {
  const [items,setItems]=useState(
    [
      {
        id:1,
        checked:false,
        name:"Reserve the Bus Ticket"
      },
      {
        id:2,
        checked:false,
        name:"Cancel the Bus Ticket"
      },
      {
        id:3,
        checked:false,
        name:"Date of the Bus"
      },
      {
        id:4,
        checked:false,
        name:"Timings Of the Bus"
      }
    ]
  )

  return (
    <div>
      <Header title="Bus Ticket Booking"/>
      <Schedule />
      <Face item={items}/>
    </div> 
  );
}

export default App;
